import { useContext } from 'react';
import { Navigate } from 'react-router';
import { AuthContext } from '../contexts/auth';

export default function Private({ children }) {
  const { signed, loading } = useContext(AuthContext);
  if (loading) {
    return <div></div>;
  }
  if (!signed) {
    return <Navigate to="/" />;
  }
  return children;
}
